const Hero = ()=>{
    return(
        <div className="Hero">
            <h1 className="heroh1">Descubrí las mejores imagenes</h1>

            <InputGroup className="inputNav">
    
    <FormControl className="inputNav1"/>

            <InputGroup.Append className="inputNav3">
                <DropdownButton as={InputGroup} title="Buscar" id="bg-nested-dropdown" variant="">
                    <Dropdown.Item>Fotos</Dropdown.Item>
                    <Dropdown.Item>Galerías</Dropdown.Item>
                    <Dropdown.Item>Fotógrafos</Dropdown.Item>
                </DropdownButton>
            </InputGroup.Append>
        </InputGroup>

        </div>


    )
}

export default Hero;
